sap.ui.define(["sap/ui/test/opaQunit","./pages/Master","./pages/NotFound","./pages/Browser"],function(e){"use strict";QUnit.module("Desktop not found");e("Should see the resource not found page when navigating to an invalid hash",function(e,o,t){e.iStartMyApp();o.onTheMasterPage.iWaitUntilTheListIsLoaded();o.onTheBrowserPage.iChangeTheHashToSomethingInvalid();t.onTheNotFoundPage.iShouldSeeTheNotFoundPage().and.theNotFoundPageShouldSayResourceNotFound();t.iTeardownMyApp()});e("Should see the not found master and detail page if an invalid object id has been called",function(e,o,t){e.iStartMyApp({hash:"/Orders/SomeInvalidObjectId"});t.onTheNotFoundPage.iShouldSeeTheObjectNotFoundPage().and.theNotFoundPageShouldSayObjectNotFound();t.iTeardownMyApp()});e("Should see the not found text for no search results",function(e,o,t){e.iStartMyApp();o.onTheMasterPage.iSearchForNotFound();t.onTheMasterPage.iShouldSeeTheNoDataText();t.iTeardownMyApp()})});